'<u>Question:</u> What is the distribution of cities across continents based on their air quality and happiness/culture/leisure scores, and how does this distribution reflect on regional quality of life factors? <br>',
'This analysis aims to explore the correlation between the distribution of cities across continents and their corresponding air quality, as well as happiness, culture, and leisure scores. By dissecting how cities are spread across each continent based'
||' on these metrics, valuable insights into regional quality of life factors can be gleaned. Employing a CASE statement enables the categorization of cities into distinct quality of life tiers, facilitating a clearer understanding of how cities within '
||'each continent compare in terms of these crucial factors. The classification into three tiers - "High Quality of Life," "Moderate Quality of Life," and "Low Quality of Life" - is based on their air quality and happiness/culture/leisure scores. A pie '
||'chart ',
'<br><br>',
'',
'The query looks at the distribution of cities across continents concerning their air quality and happiness/leisure scores, providing an understanding of regional quality of life factors. By using a CASE statement to categorize cities into different q'
||unistr('uality of life tiers based on their scores, the query offers a structured approach to assessing the data. Cities are segmented into three tiers in the output:\201D High Quality of Life,\201D\201D Moderate Quality of Life,\201D and\201D Low Quality of Life,\201D enabling sta')
||'keholders to see patterns within each continent. <br><br>',
'',
'Sorting the results by continent, air quality, and happiness/culture/leisure scores allows for an analysis of regional disparities. This sorting facilitates the identification of cities that excel both air quality and happiness/culture/leisure scores'
||', indicating high quality of life. Conversely, cities with lower scores in these categories may reflect challenges in maintaining a satisfactory standard of living. <br><br>',
'',
'By overserving the distribution of cities across continents and their corresponding quality of life tiers, stakeholders can gain insight into regional variations in environmental conditions and overall well-being. This information can inform decision'
||' making processes aimed at improving quality of life factors in different geographical areas, ultimately contributing to the enhancement of living standards worldwide. <br><br>'))
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
  'expand_shortcuts', 'N',
  'output_as', 'HTML')).to_clob
);
wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(103058208676316755702)
,p_plug_name=>'Quality Life Meter'
,p_region_template_options=>'#DEFAULT#'
,p_component_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(101836570002853094888)
,p_plug_display_sequence=>40
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'Continent.ContinentName,',
'City.CityName,',
'City.AirQuality,',
'City.HappinessCultureAndLeisure,',
'CASE ',
'WHEN City.AirQuality >= 75 AND City.HappinessCultureAndLeisure >= 75 	THEN ''High Quality of Life'' ',
'WHEN City.AirQuality >= 50 AND City.HappinessCultureAndLeisure >= 50 	THEN ''Moderate Quality of Life'' ',
'ELSE ''Low Quality of Life'' ',
'END AS QualityOfLifeTier ',
'FROM City ',
'JOIN Country ON City.CountryID = Country.CountryID ',
'JOIN Continent ON Country.ContinentID = Continent.ContinentID ',
'ORDER BY ',
'Continent.ContinentName, ',
'City.AirQuality DESC, ',
'City.HappinessCultureAndLeisure DESC;',
''))
